import React from "react";

export const VinoDetail = ({ vino }) => {
  return (
    <div>
      <h2>{vino.nombre}</h2>
      <p><strong>Año:</strong> {vino.año}</p>
      <p><strong>Tipo:</strong> {vino.tipo}</p>
      <p><strong>Precio:</strong> {vino.precio} €</p>
    </div>
  );
};
